import { Container, withStyles } from "@material-ui/core";


export const SectionContainer = withStyles({
        root: {
            paddingTop: "32px",
            paddingBottom: "32px"
        },
      })(Container);


export const TopSectionContainer = withStyles({
        root: {
            backgroundImage: "url(/img/header_club_green.png)",
            paddingTop: "32px",
            paddingBottom: "32px"
        },
        text: {
            color: 'white'
        }
      })(Container);
